import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './components/template/home/home.component';
import { LoginComponent } from './account/login/login.component'
import { EventsReadComponent } from './components/events-read/events-read.component'
import { AuthenticationComponent } from './components/template/authentication/authentication.component';



const routes: Routes = [
 {
  path: '',
  component: HomeComponent,
  children: [
    { path: '',
      component: EventsReadComponent },
  ]
 },
 {
  path: '',
  component: AuthenticationComponent,
  children: [
    {
      path: '', redirectTo: 'login', pathMatch: 'full'
    }
  ]
 }
]

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
